import { ItemType } from './types';

export interface ItemGridProp{
  data: ItemType[]
  clickedItem: (value) => {}
}
const ItemGrid = (props: ItemGridProp) => (
  <div style={{flex: 1}}>
    {props.data.map((item: ItemType) => <img onClick={(e) => {console.log(e),props.clickedItem(this.clone())}} key={item.id} alt={item.image} style={{width: '25%'}} src={item.image}/>)}
  </div>
)

export default ItemGrid
